tables.table_schema:
CREATE TABLE Strategy (
    strategy_id INT PRIMARY KEY,
    strategy_name VARCHAR(255) NOT NULL,
    strategy_description TEXT
);

CREATE TABLE Backtest (
    backtest_id INT PRIMARY KEY,
    strategy_id INT REFERENCES Strategy(strategy_id),
    backtest_date DATE NOT NULL,
    backtest_result DECIMAL(10, 2) NOT NULL
);

CREATE TABLE Strategies (
  strategy_id INT PRIMARY KEY,
  strategy_name VARCHAR(255) NOT NULL,
  strategy_description TEXT
);

CREATE TABLE Traders (
  trader_id INT PRIMARY KEY,
  trader_name VARCHAR(255) NOT NULL,
  trader_location VARCHAR(255)
);
